myApp.controller("ContactsController",function(e,n,t,r){{var a=new Firebase(r+"users/"+n.currentUser.$id+"/meetings"),i=t(a),o=i.$asObject();i.$asArray()}o.$loaded().then(function(n){e.meetings=n}),e.addMeeting=function(){i.$push({name:e.meetingname,date:Firebase.ServerValue.TIMESTAMP}).then(function(){e.meetingname=""})},e.deleteMeeting=function(e){i.$remove(e)}});